import React from "react";
import { Switch, Route, Redirect } from "react-router-dom";

// components

import AdminNavbar from "components/Navbars/AdminNavbar.js";
import Sidebar from "components/Sidebar/Sidebar.js";
import HeaderStats from "components/Headers/HeaderStats.js";
import FooterAdmin from "components/Footers/FooterAdmin.js";

// views

import Dashboard from "views/admin/Dashboard.js";
import Maps from "views/admin/Maps.js";
import Settings from "views/admin/Settings.js";
import Tables from "views/admin/Tables.js";
import { AuthProvider } from "contexts/AuthContext";
import RegisterUser from "views/admin/RegisterUser";
import Users from "views/admin/Users";
import GestionPatients from "views/admin/GestionPatients";
import AddPatient from "views/admin/AddPatient";
import Appointment from "views/admin/Appointment";


export default function Admin() {
  return (
    <>

      <Sidebar />
      <div className="relative md:ml-64">
        <AdminNavbar />
        <HeaderStats />
        <AuthProvider>
        <div className="px-4 md:px-10 mx-auto w-full -m-24">
          <Switch>
            <Route path="/admin/dashboard" exact component={Dashboard} />
            <Route path="/admin/maps" exact component={Maps} />
            <Route path="/admin/settings" exact component={Settings} />
            <Route path="/admin/registerUser" exact component={RegisterUser} />
            <Route path="/admin/tables" exact component={Tables} />
            <Route path="/admin/AfficherUtilisateur" exact component={Users} />
            <Route path="/admin/gestionpatients" exact component={GestionPatients} />
            <Route path="/admin/AddPatient" exact component={AddPatient} />
            <Route path="/admin/AjoutRendez-vous" exact component={Appointment} />
            <Route path="/admin/AjoutRendez-vous" exact component={Appointment} />



            <Redirect from="/admin" to="/admin/dashboard" />
          </Switch>
        </div>
        </AuthProvider>
      </div>
    </>
  );
}
